import React, { useState } from 'react'
import Axios from 'axios'
import Swal from 'sweetalert2'
import { useHistory } from "react-router-dom";

export const BuscarPaciente = (props) => {
    const [rut, setrut] = useState('')

    let history = useHistory()

    const Toast = Swal.mixin({
        toast: true,
        position: 'top-end',
        showConfirmButton: false,
        timer: 3000,
        timerProgressBar: true,
        didOpen: (toast) => {
        toast.addEventListener('mouseenter', Swal.stopTimer)
        toast.addEventListener('mouseleave', Swal.resumeTimer)
        }
    })

    const handleOnChange = (e) =>{
        setrut(e.target.value)
    }

    const handleOnSubmit = (e) => {
        e.preventDefault()
        Axios.get(`https://api-rest-cfedent.herokuapp.com/pacientes/${rut}`).then( (response) => {
            if (response.data.length !== 0){
                Swal.fire(
                    'Usuario Encontrado',
                    'Se encontro el usuario: '+response.data[0].nombre,
                    'success'
                )
                history.push(`/paciente/${rut}`)
           }
            else{
                Toast.fire({
                    icon: 'error',
                    title: 'No se encontro el rut: '+rut
                })
            }
        })

    }






    return (
        <div className='container'>
            <div className='row '>
                        <div className="d-flex justify-content-center">
                        <form action='' onSubmit={handleOnSubmit}>

                            <div className="row">
                                <div className="col form-control">
                                    <input type="text" className="" id="rut" name='rut' placeholder="Rut paciente" onChange={handleOnChange} value={rut} required />
                                    <button type='submit' className='btn btn-primary'>Buscar</button>
                                </div>

                            </div>

                        </form>


                        </div>


            </div>

        </div>
    )
}
